sys_variable_value.value:
(function execute(inputs, outputs) {
    var application = new Object();
    application['sys_id'] = inputs.application_id;

    var instanceScanSuites = [];
    var atfScanSuites = [];

    var dtIS = new sn_dt.DecisionTableAPI();
    var instanceScans = dtIS.getDecisions('cc523d3e835662105706c070ceaad3a3', application);
    for(var i = 0; i < instanceScans.length; i++) {
        var suite = {};
        suite['suite_id'] = instanceScans[i].result_elements.u_instance_scan_suite_sys_id;
        suite['suite_name'] = instanceScans[i].result_elements.u_instance_scan_suite_name;
        suite['error_severity'] = instanceScans[i].result_elements.u_severity_level;
        instanceScanSuites.push(suite);
    }

    var dtATF = new sn_dt.DecisionTableAPI();
    var atfScans = new dtATF.getDecisions('d0e7b1f2839662105706c070ceaad305', application);
    for(var j = 0; j < atfScans.length; j++) {
        var suite = {};
        suite['suite_id'] = atfScans[j].result_elements.u_atf_suite_sys_id;
        suite['suite_name'] = atfScans[j].result_elements.u_atf_suite_name;
        suite['error_severity'] = atfScans[j].result_elements.u_severity_level;
        atfScanSuites.push(suite);
    }

    outputs.instance_scan_suites = instanceScanSuites;
    outputs.atf_scan_suites = atfScanSuites;
})(inputs, outputs);

